response.about:
"Сгусток вожделения"
Я ненавижу, когда волосы прилипают к блеску на губах, но мои губы всегда накрашены;
Я презираю любовь за деньги и всегда радуюсь подаркам;
Я обожаю шумные компании и ценю одиночество;
Я хочу всё и сразу, но иногда ничего для этого не делаю;
Я хочу быть образованной, но часто считаю занятия пустой тратой времени;
Я знаю, что я красива, но постоянно нуждаюсь в комплиментах;
Мне не редко доверяют, хотя не стоит;
Скромна и вульгарна;
